    display: flex;
    flex-flow: row nowrap;


`;

const RecipeImageStyled = styled.div`
    background-image: url("https://images.unsplash.com/photo-1512621776951-a57141f2eefd?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80");
    background-position: center;
    background-repeat: no-repeat;
    background-size: cover;
    border-radius: 100%;
    width: 100px;
    height: 100px;
`;

const RecipeInfoStyled = styled.div`
        background-color: green;

`;

const Recipe = () => {


    return (
        <RecipeStyled>
            <RecipeImageStyled></RecipeImageStyled>
            <div>
                <h3>Kind a long title for a plate of healthy food</h3>
                <p>Categorie: Grandma Super Special</p>
            </div>
        </RecipeStyled>
    )
}

export default Recipe
